var Taf = require("../../../");
var Ext = require("./ExtJce.js").Ext;

var list = new Taf.List(Taf.List(Ext.ExtInfo));

var sa  = new Ext.ExtInfo();
sa.stra = "sa.stra";

var sb = new Ext.ExtInfo();
sb.stra = "sb.stra";

var sc = new Ext.ExtInfo();
sc.stra = "sc.stra";

var la = new Taf.List(Ext.ExtInfo);
la.push(sa);
la.push(sb);

var lb = new Taf.List(Ext.ExtInfo);
lb.push(sc);

list.push(la);
list.push(lb);

var os = new Taf.JceOutputStream();
os.writeList(1, list);

var is = new Taf.JceInputStream(os.getBinBuffer());
var oa = is.readList(1, true, Taf.List(Taf.List(Ext.ExtInfo)));

console.log("LENGTH:", oa.length);

oa.forEach(function (value){
    value.forEach(function (iiValue, iiIndex) {
        console.log("Read forEach:", iiValue.stra, iiIndex);
    });
});
